    this.setCreditCard(creditCard);
    this.setCcNum(ccNum);
    this.setCcExpireMonth(ccExpireMonth);
    this.setCcExpireYear(ccExpireYear);
    this.setCardHolder(cardHolder);
    this.setShippingMethod(shippingMethod);
